import React from 'react';

function Footer() {
	return (
		<footer>
			<div className='inner'>
				<div className='title'>
					<h2>
						Join Divi Today.
						<br />
						Getting More Done
						<br />
						Together.
					</h2>
				</div>
			</div>
		</footer>
	);
}

export default Footer;
